import React from 'react'

import "./plusMinusButton.scss"



export default function PlusMinusButton({ imageUrl, price, name, quantity, size, operator, modifyCartItem }) {
    return (
        <button
        onClick={() => modifyCartItem()} 
        className="colorwhite" >{operator === "+" ? "+" : "-"}</button>
    )
}
